package fonts

import (
	"encoding/base64"
	"log"
)

const veraSansBase64 = ""

// VeraSans is vera.ttf font inlined to the bytes slice.
var VeraSans []byte

func init() {
	var err error
	VeraSans, err = base64.StdEncoding.DecodeString(veraSansBase64)
	if err != nil {
		log.Fatalf("Couldn't decode base64 font data: %s\n", err)
	}
}
